import { useState, useEffect } from "react";
import "../styles/dashboard.css";

export default function Biometric() {

  const [year, setYear] = useState("2024");
  const [month, setMonth] = useState("08");
  const [records, setRecords] = useState([]);

  // Sample biometric data (later from CSV / DB)
  const biometricData = {
    "2024-08-16": { in: "12:15:03", out: "17:22:06", between: "12:15:03, 12:15:10, 17:22:06" },
    "2024-08-17": { in: "09:03:27", out: "17:33:23", between: "09:03:27, 17:32:36, 17:33:23" },
    "2024-08-19": { in: "09:08:55", out: "17:27:58", between: "09:08:55, 17:27:58" },
    "2024-08-20": { in: "09:10:13", out: "17:28:45", between: "09:10:13, 17:28:45" },
    "2024-08-21": { in: "09:04:41", out: "17:50:51", between: "09:04:41, 17:50:51" },
    "2024-08-22": { in: "08:50:18", out: "17:29:52", between: "08:50:18, 17:29:52" },
    "2024-08-23": { in: "06:57:04", out: "15:39:38", between: "06:57:04, 15:39:38" },
    "2024-08-24": { in: "08:55:19", out: "17:33:04", between: "08:55:19, 17:33:04" }
  };

  // Generate full month
  useEffect(() => {
    const daysInMonth = new Date(year, month, 0).getDate();
    const temp = [];

    for (let d = 1; d <= daysInMonth; d++) {
      const dateObj = new Date(`${year}-${month}-${String(d).padStart(2, "0")}`);
      const dateStr = dateObj.toISOString().split("T")[0];
      const dayName = dateObj.toLocaleDateString("en-US", { weekday: "long" });

      if (dayName === "Sunday") {
        temp.push({
          date: dateStr,
          day: "Sunday",
          in: "",
          out: "",
          between: "",
          remark: "Sunday"
        });
      } else if (biometricData[dateStr]) {
        temp.push({
          date: dateStr,
          day: dayName,
          in: biometricData[dateStr].in,
          out: biometricData[dateStr].out,
          between: biometricData[dateStr].between,
          remark: ""
        });
      } else {
        temp.push({
          date: dateStr,
          day: dayName,
          in: "",
          out: "",
          between: "",
          remark: "Absent"
        });
      }
    }

    setRecords(temp);
  }, [year, month]);

  return (
    <div className="card">
      <h3>Biometric Attendance</h3>

      {/* FILTERS */}
      <div style={{ display: "flex", gap: "20px", marginBottom: "15px" }}>
        <select value={year} onChange={e => setYear(e.target.value)}>
          <option>2023</option>
          <option>2024</option>
          <option>2025</option>
        </select>

        <select value={month} onChange={e => setMonth(e.target.value)}>
          <option value="01">January</option>
          <option value="02">February</option>
          <option value="03">March</option>
          <option value="04">April</option>
          <option value="05">May</option>
          <option value="06">June</option>
          <option value="07">July</option>
          <option value="08">August</option>
          <option value="09">September</option>
          <option value="10">October</option>
          <option value="11">November</option>
          <option value="12">December</option>
        </select>
      </div>

      {/* BIOMETRIC TABLE */}
      <table className="timetable">
        <thead>
          <tr>
            <th>Date</th>
            <th>Day</th>
            <th>First In</th>
            <th>Last Out</th>
            <th>Between Times</th>
            <th>Remarks</th>
          </tr>
        </thead>
        <tbody>
          {records.map((r, i) => (
            <tr key={i}>
              <td>{r.date}</td>
              <td>{r.day}</td>
              <td>{r.in}</td>
              <td>{r.out}</td>
              <td>{r.between}</td>
              <td>{r.remark}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
